package com.demo.io.stream;

import java.io.FileOutputStream;
import java.io.IOException;
import java.util.Base64;

public class ByteStreamHandlerDemo1 {
	
	public static void main(String[] args) {
		
		String fileName = "resources/images/test4.jpg";
		
		String value = "";
		
		writeDatatoFile(fileName,value);
	}

	private static void writeDatatoFile(String fileName, String value) {
		
		byte[] imageBinary = Base64.getDecoder().decode(value);
		
		try (FileOutputStream fous = new FileOutputStream(fileName)) {
			fous.write(imageBinary);
			
			System.out.println();
			
		} catch (IOException e) {
			// TODO Auto-generated catch block
			e.printStackTrace();
		}
		
	}

}
